export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},o3zEWlGeOd:{data:{id:1155,attributes:{imdbId:"tt0240510",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTYzOTMxNzg0MV5BMl5BanBnXkFtZTYwMjQwMDQ3._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"},{Source:"Rotten Tomatoes",Value:"41%"},{Source:"Metacritic",Value:"49\u002F100"}],item_lang:{data:{id:1818,attributes:{title:b,plot:"Harry Feversham is a British Army officer. When his regiment is sent to fight in the Sudan, he resigns his commission. His three closest friends and fellow officers view him as a coward and each send him a white feather, a symbol of cowardice. His fiancée has the same view and does the same. Humiliated by this, Feversham sets off to the Sudan to redeem his honour.",slug:"the-four-feathers"}}},books:{data:[{id:6498,attributes:{title:b,description:"\"The Four Feathers\" by A. E. W. Mason. Published by Good Press. Good Press publishes a wide range of titles that encompasses every genre. From well-known classics & literary fiction and non-fiction to forgotten−or yet undiscovered gems−of world literature, we issue the books that need to be read. Each Good Press edition has been meticulously edited and formatted to boost readability for all e-readers and devices. Our goal is to produce eBooks that are user-friendly and accessible to everyone in a high-quality digital format.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=orTCDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[f],firstBook:true,published:"2019-11-20",publisher:"Good Press",subtitle:d}},{id:6499,attributes:{title:b,description:"English officer and gentleman Harry Feversham has wealth, social position, a beautiful fiancée, Ethne Eustace, and a brotherly bond with three close friends. But he also harbors a dark secret. Though he is expected to continue his family's proud tradition of military service, he cannot forget the shameful stories he heard as a child: tales of men who shirked their duty and disgraced themselves in battle. Fearing he too will flee from combat, Harry resigns his commission when his regiment is ordered to the war-torn Sudan. Following this decision, he receives a white feather-symbolizing cowardice-from each of his friends, and a fourth from Ethne. To redeem himself in their eyes, and his own, he embarks on an epic quest, traveling alone to Africa disguised as an Arab. As Harry endures desert heat, raging enemies, and the hellish prison known as the House of Stone, his heroic exploits become the stuff of legend. Originally published in 1902, The Four Feathers, A. E. W. Mason's best-known novel of adventure and romance, explores a plethora of complex moral issues within a framework of exotic intrigue and breakneck action. What is courage? What is cowardice? What is loyalty? And how do we balance the conflicting demands of country, family, friends, lovers, and one's own ideals?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yH7azQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["A E W Mason"],firstBook:e,published:"2020-09-19",publisher:"Independently Published",subtitle:"Large Print"}},{id:6500,attributes:{title:"The Four Feathers (Aziloth Books)",description:"A. E. Mason's classic tale of British Officer Harry Feversham's epic fight to redeem his name after receiving four white feathers - symbols of cowardice - from 3 comrades and his fiancee. A story of high adventure, love, courage and redemption set in the contrasting climes of Britain's green valleys and the deserts of the Sudan.\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=vjU3vgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[f],firstBook:e,published:"2016-08-01",publisher:d,subtitle:d}},{id:6501,attributes:{title:b,description:"English officer and gentleman Harry Feversham has wealth, social position, a beautiful fiancée, Ethne Eustace, and a brotherly bond with three close friends. But he also harbors a dark secret. Though he is expected to continue his family's proud tradition of military service, he cannot forget the shameful stories he heard as a child: tales of men who shirked their duty and disgraced themselves in battle. Fearing he too will flee from combat, Harry resigns his commission when his regiment is ordered to the war-torn Sudan. Following this decision, he receives a white feather-symbolizing cowardice-from each of his friends, and a fourth from Ethne. To redeem himself in their eyes, and his own, he embarks on an epic quest, traveling alone to Africa disguised as an Arab. As Harry endures desert heat, raging enemies, and the hellish prison known as the House of Stone, his heroic exploits become the stuff of legend. Originally published in 1902, The Four Feathers, A. E. W. Mason's best-known novel of adventure and romance, explores a plethora of complex moral issues within a framework of exotic intrigue and breakneck action. What is courage? What is cowardice? What is loyalty? And how do we balance the conflicting demands of country, family, friends, lovers, and one's own ideals? We are delighted to publish this classic book as part of our extensive Classic Library collection. Many of the books in our collection have been out of print for decades, and therefore have not been accessible to the general public. The aim of our publishing program is to facilitate rapid access to this vast reservoir of literature, and our view is that this is a significant literary work, which deserves to be brought back into print after many decades. The contents of the vast majority of titles in the Classic Library have been scanned from the original works. To ensure a high quality product, each title has been meticulously hand curated by our staff. Our philosophy has been guided by a desire to provide the reader with a book that is as close as possible to ownership of the original work. We hope that you will enjoy this wonderful classic work, and that for you it becomes an enriching experience.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9qGntgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["A.E.W. Mason"],firstBook:e,published:"2018-04-23",publisher:"Createspace Independent Publishing Platform",subtitle:"Special Edition"}},{id:6502,attributes:{title:b,description:"For centuries, presenting a comrade-in-arms with a feather was the ultimate censure and a stinging symbol of cowardice. When British soldier Harry Feversham decides to resign his post and leave the military, he is subjected to this humiliating ritual. Will his reputation ever be redeemed? Read The Four Feathers to find out.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-xTk7ONwPUAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[f],firstBook:e,published:"2011-09-01",publisher:"The Floating Press",subtitle:d}}]}}},meta:{}}},prerenderedAt:1694069556548}}("movie","The Four Feathers","series","",null,"A. E. W. Mason",1))